Com o app IL campanario Villaggio Resort você fica por dentro de todas as atividades do resort inteirinhos em poucos cliques, mesmo antes de chegar. Confira:
• Gerencie suas reservas em um mesmo lugar;
• Realize seu check-in online e passe na recepção apenas para retirar suas chaves;
• Cadastre a ficha de hóspedes uma só vez e tenha suas informações salvas para as próximas vezes que quiser voltar;
• Adicione seus hóspedes favoritos para agilizar suas reservas futuras;
• Aproveite cada minuto das suas férias navegando pelo mapa interativo e reserve as atividades que você quer participar no paraíso IL campanario Villaggio Resort;
• Acesse o extrato da sua conta em tempo real;
• Confira todas dicas de atrações do resort e divirta-se muito!

